import React, {Component} from 'react';
import Urbit from '@urbit/http-api';

window.urbit = Urbit;

class App extends Component {
  state = {};

  constructor() {
    super();
    this.init();
  };

  async init() {
    window.urbit = await Urbit.authenticate({
      ship: "zod",
      url: "localhost:8080",
      code: "lidlut-tabwed-pillex-ridrup",
      verbose: true
    });
  };

  render() {
    return <h1>Hello World</h1>;
  }
}

export default App;
